window.bookSummaryJSON = "<p>When Shane accepts a scholarship to the University of California, she doesn't expect to be housed with a homophobic roommate. Nevertheless, upon making friends with her roommate's cousin Rayne and her best friend, Shane starts to feel at home.&nbsp;</p> <p>Then, one night, while hanging out with Rayne and her friend Adam on campus, the three witness a murder. Shane's idea of a normal school year collapses, and she is suddenly the target of this murderous killer.&nbsp;</p> <p>Will the three find out who it is before it's too late, or will they be the next victim of serious crime?</p>"; 
